// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IVerifier {
    function verifyProof(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[1] memory input
    ) external view returns (bool);
}

contract TrainingReward {

    address public node;
    bytes32 public merkleRoot;
    uint256 public rewardAmount;
    bool public rewardClaimed;

    IVerifier public verifier;

    constructor(
        address _node,
        bytes32 _merkleRoot,
        address _verifier
    ) payable {
        require(msg.value > 0, "Reward must be funded");

        node = _node;
        merkleRoot = _merkleRoot;
        rewardAmount = msg.value;
        verifier = IVerifier(_verifier);
    }

    function claimReward(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[1] memory input
    ) external {

        require(msg.sender == node, "Not authorized");
        require(!rewardClaimed, "Already claimed");

        bool valid = verifier.verifyProof(a, b, c, input);
        require(valid, "Invalid proof");

        rewardClaimed = true;
        payable(node).transfer(rewardAmount);
    }
}

